import groovy.json.JsonSlurper
import org.json.simple.parser.JSONParser;
import org.json.JSONObject;
import java.text.SimpleDateFormat;
import java.util.*;

//============================================================
def sdf = new SimpleDateFormat("dd-MM-yyyy");
Date startTime = new Date();
def cur_Time = sdf.format(startTime);

def EvidencePath = context.testCase.testSuite.project.getPropertyValue("EvidencePath");
File file = new File(EvidencePath+"\\ManageRequirementRequest");
if (!file.exists()) 
{
    file.mkdir();
}

def fileName = "GetClaim_(" + cur_Time+')';

//////////Writing To External Storage
def ReqFile =EvidencePath+"\\ManageRequirementRequest\\"+ "Request_" + fileName+".doc"
def Req = context.expand('${GetClaim#Request}');
def iReq = new File(ReqFile);
iReq.write(Req, "UTF-8");

def ResFile =EvidencePath+"\\ManageRequirementRequest\\"+ "Response_" + fileName+".doc"
def Res = context.expand('${GetClaim#Response}');
def iRes = new File(ResFile);
iRes.write(Res, "UTF-8");

//====================================================
def jsonString = context.expand('${Response}').toString();
jsonResponse = new JsonSlurper().parseText(jsonString)

def eventDate = jsonResponse._Result.claim.eventDate;
def losses = jsonResponse._Result.losses.loss.className[0];
def lossName = jsonResponse._Result.losses.loss.lossName[0];
def lossCode = jsonResponse._Result.losses.loss.lossCode[0];
def description = jsonResponse._Result.deliveredServices.loss.identifier.description[0];
def declarationDate = jsonResponse._Result.claim.declarationDate;

assert eventDate!="1900-01-01";//////////////////////////////Assert 1 To Check default date should not come

if(losses == "aSPLIC_STDLoss")
{
	assert lossName == "Short Term Disability";//////////////////////////////Assert 2 To Check Loss name & code are coming properly or not
	assert lossCode == "STD";//////////////////////////////Assert 3
}
else if(losses == "aSPLIC_LTDLoss")
{
	assert lossName == "Long Term Disability";//////////////////////////////Assert 2 To Check Loss name & code are coming properly or not
	assert lossCode == "LTD";//////////////////////////////Assert 3	
	assert description.contains("Short Term Disability");
}
else if(losses == "aSPLIC_DeathLoss")
{
	assert lossName == "Death of the Insured";//////////////////////////////Assert 2 To Check Loss name & code are coming properly or not
	assert lossCode == "DCP";//////////////////////////////Assert 3
	assert description.contains("Death of the Insured");
}

def amount = jsonResponse._Result.deliveredServices.indemnifications.indemnifcation.benefitAmount.amount[0];
if(amount != null)
{
	assert amount[0]>0;//////////////////////////////Assert 5
}

