sheet.setColumnWidth(2, 10000);
sheet.setColumnWidth(3, 20000);
XSSFRow row;
row = sheet.createRow(0);
row.createCell(0).setCellValue("Group");
row.createCell(1).setCellValue("Service");
row.createCell(2).setCellValue("Status");
row.createCell(3).setCellValue("Reason");
int i = 0, j= 1,totalTestCaseCount = 0,failTestCaseCount=0,notRunTestCaseCount=0,passTestCaseCount=0;

CellStyle backgroundStyle = workbook1.createCellStyle();
backgroundStyle.setFillForegroundColor(IndexedColors.GREEN.getIndex());

testSuite.testCaseList.each 
{	
	def testCaseName = "${it.name}";
	//log.info "TC="+testCaseName;
   	it.testStepList.each 
   	{       	
      	//===============================================================
      	if(it.metaClass.hasProperty(it,'assertionStatus'))
      	{
      		totalTestCaseCount++;
      		i++;
      		row = sheet.createRow(i);
   			row.createCell(0).setCellValue(testCaseName);
   			row.createCell(1).setCellValue("${it.name}");

      		if(it.assertionStatus == AssertionStatus.FAILED)
			{
				failTestCaseCount++;				
				row.createCell(2).setCellValue("Failed");
			}
			else if(it.assertionStatus == AssertionStatus.VALID)
			{
				passTestCaseCount++;
				row.createCell(2).setCellValue("Passed");
			}
			else if(it.assertionStatus == AssertionStatus.UNKNOWN)
			{
				notRunTestCaseCount++;
				row.createCell(2).setCellValue("Not Run");
			}
		}
		//===============================================================
		//log.info(“Time :” + messageExchange.getTimeTaken())
   	}
}

row = sheet.createRow(i+2);
row.createCell(0).setCellValue("Total Unit Test");
row.createCell(2).setCellValue("$totalTestCaseCount");

row = sheet.createRow(i+3);
row.createCell(0).setCellValue("Pass Test Case");
row.createCell(2).setCellValue("$passTestCaseCount");

row = sheet.createRow(i+4);
row.createCell(0).setCellValue("Fail Test Case");
row.createCell(2).setCellValue("$failTestCaseCount");

row = sheet.createRow(i+5);
row.createCell(0).setCellValue("Not Run Test Case");
row.createCell(2).setCellValue("$notRunTestCaseCount");

workbook1.write(out);
out.close();

